import Step from "./Step"

export default function HowItWorks({data}) {

    allSteps = data.map(item => (
        <Step 
            key={item}
            item={item}
        />
    ))
    return (
        <section className="container__how-it-works">
            <h2>How Stitch Fix works</h2>
            <div className="container_steps">
            {allSteps}
            </div>
        </section>
    )
}
